import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import RegisterPage from "./components/RegisterPage";
import LoginPage from "./components/LoginPage";
import LandingPage from "./components/LandingPage";
import RentPage from "./components/RentPage";
import PartTimeJobPage from "./components/PartTimeJobPage";
import JobResultsPage from "./components/JobResultsPage";

function App() {
  return (
    <Router>
      <Routes>
        {/* Default route â†’ Register */}
        <Route path="/" element={<RegisterPage />} />

        {/* Auth flow */}
        <Route path="/login" element={<LoginPage />} />
        <Route path="/landing" element={<LandingPage />} />

        {/* Accommodation flow */}
        <Route path="/rent" element={<RentPage />} />

        {/* Jobs flow */}
        <Route path="/parttimejobs" element={<PartTimeJobPage />} />
        <Route path="/jobresults" element={<JobResultsPage />} />

        {/* Fallback */}
        <Route path="*" element={<RegisterPage />} />
      </Routes>
    </Router>
  );
}

export default App;
